var _hoisted_10 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<hr><section class=\"section\"><div class=\"container content is-medium\"><div class=\"columns\"><div class=\"column is-4\"><div class=\"content\"><h3>Welcome</h3><p>Welcome to GASPS, the technical assistance system for Georgias Alcohol Substance Abuse Prevention Project (ASAPP).</p></div></div><div class=\"column is-4\"><div class=\"content\"><h3>ASAPP State Wide Goals</h3><ul class=\"list-unstyled\"><li><strong>Goal 1:</strong> Reduce the early onset of alcohol use among 9-20 year olds </li><li><strong>Goal 2:</strong><ol><li>Reduce access to alcohol among 9-20 year olds</li><li>Reduce binge drinking among 9-20 year olds</li></ol></li><li><strong>Goal 3:</strong> Reduce binge drinking and heavy drinking among 18-25 year olds </li></ul></div></div><div class=\"column is-4\"><div class=\"content\"><h3>We Provide</h3><ul><li>Training by Subject Matter Experts (SME)</li><li>Research-based knowledge and reliable information</li><li>Guidance through the implementation process</li><li>Assistance in problem solving and goal attainment</li><li>Resource and referral information</li></ul></div></div></div></div></section><section class=\"section\"><div class=\"container content is-medium\"><div class=\"columns\"><div class=\"column is-8\"><div class=\"content\"><h3>Prevention in the State of Georgia</h3><p>Prevention is a proactive process that enables individuals to create and reinforce conditions that promote healthy behaviors and lifestyles. The Office of Behavioral Health Prevention (OBHP) supports the health and well being of individuals, families and communities by reducing the use and abuse of substances and their related consequences across the lifespan, and delaying the onset of substance use by youth using a data-driven planning process that targets high priorities for all categories of the population defined by the Institute of Medicine.</p></div></div><div class=\"column is-4\"><img src=\"/assets/images/georgia.jpg\" style=\"display:inline-block;float:right;margin-top:1em;margin-right:50px;height:212px;\"></div></div></div></section><section class=\"section\"><div class=\"container content is-medium\"><div class=\"columns\"><div class=\"column is-4 col-md-pull-8\"><img src=\"/assets/images/the-behavioral-health-continuum-model.png\" style=\"display:inline-block;float:right;margin-top:1em;height:175px;\"></div><div class=\"column is-8 col-md-push-4\"><div class=\"content\"><h3>Prevention in the State of Georgia</h3><p>The Institute of Medicines Continuum of Care (also known as the mental health intervention spectrum) is a classification system that presents the scope of behavioral health services: promotion of health, prevention of illness/disorder, treatment, and maintenance/recovery.</p><p><strong>Promotion</strong> involves interventions (e.g., programs, practices, or environmental strategies) that enable people to increase control over, and to improve, their health.10 As such, interventions that promote health occur independently as well as throughout the continuum of care as part of prevention, treatment, and maintenance/recovery. </p><p><strong>Prevention</strong> focuses on interventions that occur prior to the onset of a disorder and which are intended to prevent the occurrence of the disorder or reduce risk for the disorder.14 Prevention is also about striving to optimize well-being. </p><p><strong>Treatment</strong> interventions include case identification and standard forms of treatment (e.g., detoxification, outpatient treatment, in-patient treatment, medication-assisted treatment). </p><p><strong>Maintenance</strong> includes interventions that focus on compliance with long-term treatment to reduce relapse and recurrence and aftercare, including rehabilitation and recovery support. </p><p><strong>Recovery</strong> is a process of change through which individuals improve their health and wellness, live a self-directed life, and strive to reach their full potential. </p></div></div></div></div></section><section class=\"section\"><div class=\"container content is-medium\"><div class=\"columns\"><div class=\"column is-8\"><div class=\"content\"><h3>About the Strategic Prevention Framework (SPF)</h3><p>SAMHSA&#39;s Strategic Prevention Framework (SPF) is a 5-step planning process to guide the selection, implementation, and evaluation of effective, culturally appropriate, and sustainable prevention activities. The effectiveness of this process begins with a clear understanding of community needs and depends on the involvement of community members in all stages of the planning process.</p><p>SPF Logo The SPF includes these five steps:</p><ul class=\"list-unstyled\"><li><b>Step 1.</b> Assess Needs </li><li><b>Step 2.</b> Build Capacity </li><li><b>Step 3.</b> Plan </li><li><b>Step 4.</b> Implement </li><li><b>Step 5.</b> Evaluation </li></ul><p>These steps are guided by the principles of cultural competence and sustainability. The SPF is designed to help States, Jurisdictions, Tribes, and communities build the infrastructure necessary for effective and sustainable prevention. Each step contains key milestones and products that are essential to the validity of the process. Focused on systems development, the SPF reflects a public health, or community-based, approach to delivering effective prevention.</p></div></div><div class=\"column is-4\"><img src=\"/assets/images/spf2.png\" style=\"display:inline-block;float:right;margin-top:1em;width:275px;\"></div></div></div></section><section class=\"section\"><div class=\"container content is-medium\"><div class=\"columns\"><div class=\"column is-8 col-md-push-4\"><div class=\"content\"><h3>About Environmental Strategies</h3><p>Environmental strategies are prevention efforts aimed at changing or influencing community standards, institutions, structures or attitudes that shape individuals behaviors. While individual approaches focus on helping people develop the knowledge, attitudes, and skills they need to change their behavior, environmental approaches focus on creating an environment that makes it easier for people to act in healthy ways.</p></div></div><div class=\"column is-4 col-md-pull-8\"><img src=\"/assets/images/research-icon.png\" style=\"width:275px;float:right;\"></div></div></div></section>", 6);

