var _hoisted_47 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<div class=\"cbp-ntcontent\"><p>Resources exist in your organization and in the community you serve. At the organizational level, you may decide to strengthen data collection systems, re-allocate staff workloads to improve efficiency, or increase coordination with other state systems to build capacity for implementing your prevention intervention.</p><p>At the community level, create planning groups that reflect the ethnic make-up of the community. These groups can help the prevention effort be more successful through their resources and support.</p><p>Resources include:</p><ul><li>Grants or donations</li><li>Donated meeting space, food, photocopying services, or computer hardware and software</li><li>Program promotion or advertising outreach</li><li>Consultants and/or volunteers who can supplement staff expertise</li><li>Stakeholders, including those who are a part of the population the intervention will focus on</li><li>Other collaborators who can provide additional expertise, necessary services, or connections to your target population</li><li>Local champions who will support your prevention efforts</li></ul></div>", 1);

