var _hoisted_49 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<div class=\"cbp-ntcontent\"><p> The success of any prevention effort depends on the knowledge and skill of the people delivering the intervention. <a href=\"http://www.samhsa.gov/workforce\" target=\"_blank\">Workforce</a> development is more than simply preparing people to complete specific tasks. Staff must have the right credentials, training, experience, cultural competence, and expertise to address all aspects of prevention. Leaders and staff may need to be hired or may require additional training and technical assistance. </p><h5>Publications and Resources</h5><ul><li><a href=\"http://www.samhsa.gov/capt/tools-learning-resources/capacity-building-sustainability\" target=\"_blank\">Factors that Contribute to Capacity-Building and Sustainability</a></li><li><a href=\"http://www.samhsa.gov/capt/tools-learning-resources/21st-century-partners-prevention\" target=\"_blank\">21st Century Partners in Prevention</a></li><li><a href=\"http://www.samhsa.gov/capt/tools-learning-resources/partnerships-resources-substance-misuse-suicide\" target=\"_blank\">Mobilizing Partnerships and Resources to Address Substance Abuse and Suicide Webinar  2014</a></li><li><a href=\"http://www.samhsa.gov/capt/tools-learning-resources/building-capacity-through-collaboration\" target=\"_blank\">Building Prevention Capacity through Collaboration Video  2012</a></li></ul></div>", 1);

