var _hoisted_54 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<h2>Play Narration</h2><audio controls><source src=\"http://resources.ga-sps.org/content/spf/spf-strategic-planning.m4a\" type></audio><p>Step 3 of the Strategic Prevention Framework (SPF) shows how to plan effectively by prioritizing risk and protective factors and building logic models.</p><p><b>Planning increases the effectiveness of prevention efforts by ensuring that prevention professionals and their stakeholders work toward the same goals. Three important parts of the planning phase are:</b></p><ul><li> Prioritizing risk and protective factors identified in <a href=\"http://www.samhsa.gov/capt/applying-strategic-prevention-framework/step1-assess-needs\" target=\"_blank\">Step 1: Assess Needs</a> of the Strategic Prevention Framework (SPF) </li><li><a href=\"http://www.samhsa.gov/capt/applying-strategic-prevention-framework/step3-plan/building-logic-models\" target=\"_blank\">Building a logic model</a> for your program </li><li><a href=\"http://www.samhsa.gov/capt/applying-strategic-prevention-framework/step3-plan\" target=\"_blank\">Selecting effective interventions</a></li></ul><br><p>As you plan, keep in mind that decisions that reflect the input of all stakeholders, whether they are part of a formal coalition or informal group of collaborators, are more likely to keep stakeholders committed to your program.</p><p>Planning is also crucial to the sustainability of prevention outcomes. It establishes the resources needed to maintain program activities and greatly increases the likelihood that you will achieve your expected outcomes.</p><h4>Selecting Effective Interventions</h4><p>Sometimes people want to select interventions that are popular, that worked well in a different community, or that they are familiar with. However, these are not good reasons for selecting an intervention. It is more important that the prevention intervention effectively address the priority substance use problem and associated risk and protective factors, and that intervention is a good fit for the broader community.</p><p><b>There are three important criteria for selecting appropriate prevention interventions:</b></p><ul><li>The intervention is evidence-based</li><li>Good conceptual fit for the community</li><li>Good practical fit for the community</li></ul><br>", 13);

