var _hoisted_69 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<div class=\"cbp-ntcontent\"><p> Whenever possible, you should select evidencebased interventions. Evidence-based interventions have documented evidence of effectiveness and are those that research has shown to be effective. SAMHSAs guidance document <a href=\"http://store.samhsa.gov/product/Identifying-and-Selecting-Evidence-Based-Interventions-for-Substance-Abuse-Prevention/SMA09-4205\" target=\"_blank\">Identifying and Selecting Evidence-Based Interventions for Substance Abuse Prevention</a> defines evidence-based interventions as those that fall into one or more of three categories: </p><ul><li><b>Category 1.</b> The intervention is included in federal registries of evidence-based interventions, such as the <a href=\"http://www.samhsa.gov/nrepp\" target=\"_blank\">National Registry of Evidence-based Programs and Practices (NREPP);</a><b>OR</b></li><li><b>Category 2.</b> The intervention is reported with positive effects on the primary targeted outcome in peer-reviewed journals; <b>OR</b></li><li><b>Category 3.</b> The intervention has documented evidence of effectiveness, based on guidelines developed by <a href=\"http://www.samhsa.gov/about-us/who-we-are/offices-centers/csap\" target=\"_blank\">CSAP</a> and/or the state, tribe, or jurisdiction in which the intervention took place. </li></ul><br><p><b>Documented evidence should be implemented under four recommended guidelines, all of which must be followed. These guidelines require interventions to be:</b></p><ol><li> Based on a theory of change that is documented in a clear logic or conceptual mode. The Department of Health and Human Services (HHS) recommends prevention professionals <a href=\"http://www.hhs.gov/ash/initiatives/quality/quality/\" target=\"_blank\">develop a basic driver of quality diagram</a> to help their programs achieve desired outcomes. <b>AND</b></li><li> Similar in content and structure to interventions that appear in federal registries of evidence-based interventions and/or peer-reviewed journals. <b>AND</b></li><li> Supported by documentation showing it has been effectively implemented in the past, multiple times, and in a manner attentive to scientific standards of evidence. The intervention results should show a consistent pattern of credible and positive effects. <b>AND</b></li><li>Reviewed and deemed appropriate by a panel of informed prevention experts that includes qualified prevention researchers experienced in evaluating prevention interventions similar to those under review; local prevention professionals; and key community leaders, as appropriate (for example, law enforcement officials, educators, or elders within indigenous cultures).</li></ol><br><p>Its important to note, however, that these sources are not exhaustive, and they may not include interventions appropriate for all problems or all populations. In these cases, you must look to other credible sources of information. Since states have different guidelines for what constitutes credible evidence of effectiveness, you could start by talking to prevention expertsincluding your state-level evidencebased workgroup.</p></div>", 1);

