var _hoisted_71 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<div class=\"cbp-ntcontent\"><p>In addition to selecting an intervention that is evidence-based, you need to ensure that the intervention, or combination of interventions, that you select are a good fit for the community.</p><p><b>There are two types of fit to consider:</b></p><ul><li><b>Conceptual fit:</b> An intervention has good conceptual fit if it directly addresses one or more of the priority factors driving a specific substance use problem and has been shown to produce positive outcomes for members of the target population. To determine the conceptual fit, ask, Will this intervention have an impact on at least one of our communitys priority risk and protective factors? </li><li><b>Practical fit:</b> An intervention has good practical fit if it is culturally relevant for the target population, the community has capacity to support it, and if it enhances or reinforces existing prevention activities. To determine the practical fit of an intervention, ask, Is this intervention appropriate for our community? </li></ul><br><p>Evidencebased interventions with both conceptual fit and practical fit will have the highest likelihood ofproducing positive prevention outcomes.</p><p><b>Publications and Resources</b></p><ul><li><a href=\"http://www.samhsa.gov/capt/tools-learning-resources/finding-evidence-based-programs\" target=\"_blank\">Finding Evidence-based Programs and Practices</a></li><li><a href=\"http://www.samhsa.gov/capt/tools-learning-resources/strategies-interventions-prevent-youth-marijuana-use\" target=\"_blank\">Strategies and Interventions to Prevent Youth Marijuana Use</a></li><li><a href=\"http://www.samhsa.gov/capt/tools-learning-resources/south-carolina-workgroup-supports-local-efforts-curb-underage-drinking\" target=\"_blank\">South Carolina Workgroup Supports Local Efforts to Curb Underage Drinking</a></li></ul></div>", 1);

