var _hoisted_84 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<div class=\"cbp-ntcontent\"><p>Many things can influence how a program is implemented, including staff selection, staff training, staff and program evaluation, available resources, and past experience implementing prevention programs.</p><ul><li><b>Staff selection:</b> In addition to academic and professional qualifications, other characteristics may also be desirable, such as bilingualism, lived experience, or familiarity with local conditions. These characteristics must be identified and be a part of your selection criteria. </li><li><b>Pre- and in-service training:</b> Trainings are efficient ways to communicate background information, theory, program rationale, and expected outcomes. They also provide opportunities for program staff to practice new skills and receive feedback. </li><li><b>Ongoing consultation or coaching:</b> Implementing evidence-based practices and interventions may require behavior change among program staff. Training and coaching can help bring about these changes. </li><li><b>Staff and program evaluation:</b> Assessing performance and measuring program fidelity can provide useful feedback on how the staff and program are performing during implementation. </li><li><b>Program support:</b> Providing clear leadership and making use of relevant data to inform decision-making helps to keep staff organized and focused on desired outcomes. </li><li><b>History implementing prevention interventions in the past:</b> Whats your track record? Do you have past successes that you can point to and build on? </li><li> Key stakeholder support: For a program to be effective, community members must be involved in its implementation. In the short term, these stakeholders help to ensure that the prevention approach is well-matched to the target population. In the long term, stakeholders can become program champions by <a href=\"http://www.samhsa.gov/capt/applying-strategic-prevention-framework/sustainability\" target=\"_blank\">sustaining program activities</a> and prevention priorities. </li></ul></div>", 1);

