var _hoisted_86 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<div class=\"cbp-ntcontent\"><p>When a prevention program is implemented as its developer intended, there is greater likelihood that its impact will be similar to the settings where it was first implemented or tested. Maintaining fidelity means keeping most elements of the program the same. However, programs may need to be adapted to gain greater community acceptance or in response to the contexts of a particular setting. Budget constraints, staff availability, time limitations, or other issues may make adaptation necessary.</p><p>In these situations, finding the right approach to stay faithful to the original evidence-based design and address the target audiences unique characteristics requires balancing fidelity and adaptation. When you change an intervention, you may be compromising outcomes. Even so, implementing a program that requires some adaptation may be more efficient and cost-effective than designing a program from scratch.</p><h3>General Guidelines for Program Adaptation</h3><ul><li><b>Select programs with the best initial fit to local needs and conditions:</b> This will reduce the likelihood that you will need to make adaptations later on. </li><li><b>Select programs with the largest effect size:</b> Effect size refers to the magnitude of the effects of an intervention. The smaller an interventions effect size, the more careful you want to be about changing anything. You dont want to inadvertently compromise any good youre doing. In general, adaptations to programs with large effect sizes are less likely to affect expected outcomes. </li><li><b>Change capacity before changing the program:</b> It may be easier to change the program, but changing local capacity to deliver it as it was designed is a better choice. </li><li><b>Consult experts:</b> Experts can include the program developer, an environmental strategies specialist, or your evaluator. They may be able to tell you how the intervention has been adapted in the past and how well (or not) those adaptations worked. </li><li><b>Retain core components:</b> When a program retains core components of the original intervention, its more likely to be effective. If youre not sure which elements are core, consult the program developer, an environmental strategies specialist, or an evaluator. </li><li><b>Be consistent with evidence-based principles:</b> Programs and practices that adhere to evidence-based principles are more likely to be effective. Adaptations should be consistent with the science. </li><li><b>Add rather than subtract:</b> Doing so will decrease the likelihood that you are eliminating a program element that is important. </li><li><b>Effective cultural adaptation:</b> Cultural adaptation refers to program modifications that are tailored to the values, attitudes, beliefs, and experiences of the target audience. This type of adaptation relies on strong relationships with cultural leaders and access to culturally competent program staff. <a href=\"http://www.samhsa.gov/capt/applying-strategic-prevention/cultural-competence\" target=\"_blank\">Learn more about cultural competence.</a></li></ul></div>", 1);

