var _hoisted_102 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<div class=\"cbp-ntcontent\"><p>Prevention practitioners engage in a variety of evaluation-related activities, including identifying evaluation expertise, designing evaluation plans, and finding and analyzing epidemiological data. Evaluation is more than a final step. It should be a part of every aspect of the SPF, from assessing needs to communicating results.</p><p>During an evaluation, prevention practitioners ask the following questions:</p><ul><li>How successful was the community in selecting and implementing appropriate strategies?</li><li> Were these the right strategies, given the <a href=\"http://www.samhsa.gov/capt/practicing-effective-prevention/prevention-behavioral-health/risk-protective-factors\" target=\"_blank\">risk and protective factors</a> the community identified? </li><li>Were representatives from across the community involved in program planning, selection, and implementation? In what ways were they involved?</li><li>Was the planning group able to identify potential new partners with which to collaborate?</li><li>What was the quality of the data used in decision making?</li></ul><p> Engaging stakeholders who represent the populations you hope to reach greatly increases the chance that your evaluation efforts will be successful. Stakeholders can dictate how (or even whether) evaluation results are shared. Stakeholder involvement also helps to ensure that the evaluation design, including methods and the instruments used, is consistent with the cultural norms of the people you serve. Learn more about <a href=\"http://www.samhsa.gov/capt/applying-strategic-prevention/cultural-competence\" target=\"_blank\">cultural competence</a> in prevention practice. </p></div>", 1);

